;; **
;;; Now, we draw some samples and plot them.
;; **

;; @@
(defn draw-samples [n-samples thin]
  "simple helper to draw samples and thin them"
  (loop [sampler (doquery :pgibbs gmm [X {:K 8}] :debug true :number-of-particles 100)
         result []]
    (if (= (count result) n-samples)
      result
      (let [sampler (reduce (fn [sampler _] (rest sampler)) sampler (range (dec thin)))
            value (first sampler)]
        (recur (rest sampler) (conj result value))))))


;; draw 10 samples, thinning every 200
(def samples (draw-samples 10 200))

;; plot them, each; see how the samples evolve?
(map (fn [sample]
       (let [y-hat (:z (get-predicts sample))]
         (plot-pca X y-hat #(get colors %))))
     samples)

